import { FC, memo } from "react";
import { HeaderOnly } from "../templates/layout/HeaderOnly";
import { Box, Button, Flex, Link } from "@chakra-ui/react";
import { useNavigate } from "react-router";

export const Setting: FC = memo(() => {
  const navigation = useNavigate();
  const onClickEditProfile = () => navigation("/home/setting/editProfile");
  const onClickEditPassword = () => navigation("/home/setting/editPassword");
  return (
    <HeaderOnly>
      <Flex
        align="center"
        fontSize="sm"
        flexGrow={2}
        display={{ base: "none", md: "flex" }}
      >
        <Box pr={4}>
          <Button onClick={onClickEditProfile}>社員情報編集</Button>
        </Box>
        <Box pr={4}>
          <Button onClick={onClickEditPassword}>パスワード再設定</Button>
        </Box>
      </Flex>
    </HeaderOnly>
  );
});
